import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import CTAButton from '../components/CTAButton';
import ServiceCard from "../components/ServiceCard";

export default function Index (){
    return (
        <div>
            <Navbar />
            <main>
                <CTAButton link="/connect" >Connect</CTAButton>
                <ServiceCard link="/services" img="/icon1.png" caption="Social & Content Marketing" />
            </main>
            <Footer />


            <style jsx global>
                {`
                    body{
                        margin:0;
                        font-family: 'Gayathri', Helvetica, sans-serif;
                        box-sizing: border-box;
                        background-color: white;
                        overflow-x: hidden;
                        max-width: 100vw;
                        min-height: 100vh;
                    }

                    html{
                        scroll-behavior: smooth; /*currently only Firefox and Chrome */
                        font-size:10px;
                        overflow-x: hidden;
                        --main-color:#1B0DA5;
                        --accent-color:#FCFC42;
                        --secondary-color:#050037;
                        
                    }

                    main{
                        min-height: 50vh;
                        border:1px solid red;
                        background-color:var(--main-color);
                    }
                `}
            </style>
        </div>
    )
}
